import Layout from "../components/Layout";

const About = () => (
  <Layout>
    <style jsx>
      {`
        h2 {
          color: green;
        }
      `}
    </style>
    <h2>안녕하세요 저는 Velopert 입니다.</h2>
  </Layout>
);

export default About;
